(1, '2020-01-14', 1333, '2020 Clinical Performance DesignShop', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><p><em>These materials are intended ONLY for those who attended the \"2020 Clinical Performance DesignShop\" held in Savannah, GA on January 14-16, 2020.</em></p><h2>Activity description</h2><p>The DesignShop is an annual conference focusing on clinical performance. The DesignShop helps kick-start the year, align top priorities, and foster opportunities for our teams to drive even higher levels of performance. The conference is an intense, but immensely rewarding, two-day working session. Initiative topics are selected based on the most impactful ideas relating to Risk, Quality and Affordability.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />This activity is supported by OptumCare.<br /><br /><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Activity planners and faculty</strong><br />Kenneth Cohen, MD, FACP<br />Chief Medical Officer<br />New West Physicians</p><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education</p><p>Hany Farid, MD, FACS<br />Community Medical Director<br />San Fernando Valley, HealthCare Partners</p><p>Ramon Figueroa, MD<br />Chief Medical Information Office<br />WellMed Medical Management</p><p>Daniel S. Frank, MD<br />Chief Medical Officer<br />OptumCare</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education</p><p>Kevin Heath, MD<br />Medical Director<br />OptumCare</p><p>Kent Hu, MD MPH<br />Medical Director of Quality and Patient Safety<br />The Everett Clinic, Part of OptumCare</p><p>Verni Jogaratnam, MD<br />SVP &amp; Chief Medical Officer<br />NAMM California &amp; OptumCare</p><p>Michael J. Sheehy, MD<br />Chief of Population Health &amp; Analytics<br />Reliant Medical Group, Inc.</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in the control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.<br /><br />OptumHealth Education ensures that the content is independent of commercial bias.<br /><br />Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.<br /><br />The remaining activity faculty or planners have no financial relationships to disclose.<br /></p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accrediation Logo\" class=\"media-element file-wysiwyg\" data-delta=\"1\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110_0.gif\" width=\"110\" height=\"70\" />In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><strong>Credit Designation Statements<br />Nurses</strong><br />The participant will be awarded up to 13.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Pharmacists/Pharmacy technicians</strong><br />This activity is approved for 13.00 contact hours ([1.30] CEU) in states that recognize ACPE.<br />Attending the full program will earn 13.00 contact hours.<br />Unique Activity Number(s): JA0007123-0000-20-122-L04-P/T</p><p><strong>Physicians</strong><br />OptumHealth Education designates this live activity for a maximum of 13.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>Physician Assistants</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-Certified Coders</strong><br />AAPC will honor 1-for-1 CEUs for any live event offering CME credit or AMA PRA Category 1 Credit. A certificate of attendance or completion is necessary to show participation. The certificate will give the total CMEs possible for the offering. Physicians are advised to claim only the actual hours that they were present during the education. We ask that AAPC-certified members abide by this request also. One hour of instruction is worth 1 CEU.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization to which you wish you apply credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63250, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(2, '2020-02-03', 1333, 'Infectious Disease Challenges in Solid Organ Transplantation', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 16, 2019.</em></p><p>The potential etiologies of infection are diverse and can often progress rapidly in solid organ transplant (SOT) patients. Many challenges exist in the prevention, diagnosis, clinical consequences, and management of infectious disease in transplant recipients with emerging issues, including donor-derived infection, the impact of pandemic influenza in the SOT recipient, and drug-resistant infections. This presentation will identify atypical presentations of infections in SOT and explore future directions in diagnostics and therapeutics in this field.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Fishman80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><p><strong>Infectious Disease Challenges in Solid Organ Transplantation</strong><br />Jay Alan Fishman, MD<br />Professor of Medicine, Harvard Medical School;<br />Associate Director, Mass General Transplant Center;<br />Director, Transplant Infectious Diseases and Compromised Host Program<br />Massachusetts General Hospital<br />Boston, MA</p></td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Planning Committee</span></h1><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>C. Fred LeMaistre, MD<br />Senior Vice President<br />Sarah Cannon Market Operations<br />Physician in Chief of Blood Cancers<br />Sarah Cannon<br />Nashville, TN</p><p>Tina Rydland, PharmD<br />Crystal Clear Rx<br />Denver, CO</p><p>Crystal Wong, MD<br />President<br />Propoint Medical Writing<br />Wexford, PA</p><p><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Disclosures of relevant financial relationships</span></p><p>In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education (OHE) requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content. OHE ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>Dr. Wong has indicated that she has received grant/research support from MyoKardia.</p><p>The remaining activity faculty and planners haveno financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Method for calculating CE credit</strong><br />CE credit was calculated by the complexity of content.</p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"http://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><br /><strong>Credit Designation Statements</strong><br /><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Pharmacists/Pharmacy technicians</strong><br />This activity is approved for 1.00 contact hour(s) ([0.10] CEU) in states that recognize ACPE.<br />Attending the full program will earn 1.00 contact hour(s).<br />Unique Activity Number(s): JA0007123-0000-20-123-H01-P/T</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>Case managers</strong><br />The Commission for Case Manager Certification has approved this program for a maximum of 1.00 clock hour(s) for Certified Case Managers (CCM).</p><p><strong>Psychologists andsocial workers</strong><br />Participants must have attended the entire Web-based activity and completed an evaluation to receive a certificate. Partial credit is not available.</p><p><strong>Psychologists</strong><br />OptumHealth Education is approved by the American Psychological Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social Workers</strong></p><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; width: 20%;\"><p style=\"text-align: left;\"><img alt=\"ACE Logo\" border=\"0\" height=\"51\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_135x51sm.jpg\" width=\"135\" /></p></td><td style=\"vertical-align:top; width: 80%;\"><p>As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63268, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(3, '2020-02-03', 1333, 'Transplant Trends: Current Data and Statistics', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 14, 2019.</em></p><p>The need for organ donation is immense. This presentation discussesthe use of national data to identify strategies to drive improvement in donation and address inequities in transplant.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Gentry80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><p><strong>Transplant Trends: Current Data and Statistics</strong><br />Sommer Gentry, PhD<br />Professor, Mathematics Department<br />United States Naval Academy<br />Annapolis, MD<br />Research Associate, Department of Surgery<br />Johns Hopkins University School of Medicine<br />Baltimore, MD</p></td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Planning Committee</span></h1><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>C. Fred LeMaistre, MD<br />Senior Vice President<br />Sarah Cannon Market Operations<br />Physician in Chief of Blood Cancers<br />Sarah Cannon<br />Nashville, TN</p><p>Tina Rydland, PharmD<br />Crystal Clear Rx<br />Denver, CO</p><p>Crystal Wong, MD<br />President<br />Propoint Medical Writing<br />Wexford, PA</p><p><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Disclosures of relevant financial relationships</span></p><p>In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education (OHE) requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content. OHE ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>Dr. Wong has indicated that she has received grant/research support from MyoKardia.</p><p>The remaining activity faculty and planners haveno financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Method for calculating CE credit</strong><br />CE credit was calculated by the complexity of content.</p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"http://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><br /><strong>Credit Designation Statements</strong><br /><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Pharmacists/Pharmacy technicians</strong><br />This activity is approved for 1.00 contact hour(s) ([0.10] CEU) in states that recognize ACPE.<br />Attending the full program will earn 1.00 contact hour(s).<br />Unique Activity Number(s): JA0007123-0000-20-124-H01-P/T</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>Case managers</strong><br />The Commission for Case Manager Certification has approved this program for a maximum of 1.00 clock hour(s) for Certified Case Managers (CCM).</p><p><strong>Psychologists andsocial workers</strong><br />Participants must have attended the entire Web-based activity and completed an evaluation to receive a certificate. Partial credit is not available.</p><p><strong>Psychologists</strong><br />OptumHealth Education is approved by the American Psychological Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social Workers</strong></p><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; width: 20%;\"><p style=\"text-align: left;\"><img alt=\"ACE Logo\" border=\"0\" height=\"51\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_135x51sm.jpg\" width=\"135\" /></p></td><td style=\"vertical-align:top; width: 80%;\"><p>As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63274, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(4, '2020-02-03', 1333, 'Optimizing Care for Individuals with Type 2 Diabetes and Cardiovascular Disease: a Multidisciplinary Approach', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 15, 2019.</em></p><p>The public health impact of type 2 diabetes (T2D) and cardiovascular disease (CVD) in the U.S. is immensecompared to people without diabetes, patients with diabetes are twofour times more likely to develop CVD. Several medications for T2D have been found to reduce cardiovascular events and mortality in patients with T2D, however treatments are not consistently used and preventable death and disability are occurring. This presentation will identify ways in which, through a multidisciplinary team approach, specific interventions at cardiology clinics may be applied to achieve best practices in improving patient care.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Granger80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><p><strong>Optimizing Care for Individuals with Type 2 Diabetes and Cardiovascular Disease: a Multidisciplinary Approach</strong><br />Christopher B. Granger, MD<br />Professor of Medicine<br />Director, Cardiac Intensive Care Unit<br />Duke University Medical Center<br />Durham, NC</p></td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Planning Committee</span></h1><p>Sarah Chart, RN<br />Senior Director