Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social Workers</strong></p><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; width: 20%;\"><p style=\"text-align: left;\"><img alt=\"ACE Logo\" border=\"0\" height=\"51\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_135x51sm.jpg\" width=\"135\" /></p></td><td style=\"vertical-align:top; width: 80%;\"><p>As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63304, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(9, '2020-02-03', 1333, 'Update in the Utilization of Blood/Marrow Transplant and Emerging Diagnoses on the Horizon', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 14, 2019.</em></p><p>The number of blood/marrow transplants (BMTs) performed every year in the U.S. has markedly increased over the last two decades and doubled between 2000 and 2015. Factors that contribute to the rising incidence of BMTs include expansion of populations in which BMT is most commonly used, increases in unrelated-donor registries and cord blood inventories, improved outcomes in unrelated-donor transplants, and higher rates of BMT with less-intense conditioning regimens in older patients. This session will discuss contributing factors to the increase in BMT utilization and emerging indications.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/komanduri80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><p><strong>Update in the Utilization of Blood/Marrow Transplant and Emerging Diagnoses on the Horizon</strong><br />Krishna V. Komanduri, MD<br />Kalish Family Chair in Stem Cell Transplantation<br />Professor of Medicine, Microbiology &amp; Immunology<br />Chief, Division of Transplantation and Cellular Therapy<br />University of Miami Sylvester Comprehensive Cancer Center<br />Miami, FL</p></td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Plan