(12, '2020-02-03', 1333, 'Cancer Survivorship: A Personalized Precision Approach', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 16, 2019.</em></p><p>Numerous genetic and environmental factors influence cancer prognosis and outcomes. The interaction between genetic and environmental risk factors for cancer is complex, but understanding how they influence cancer risk and prognosis can lead to personalized treatment and a more precise prediction of outcomes. Ri