(13, '2020-02-03', 1333, 'Advances in Abdominal Transplant in the Last Quarter Century', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 16, 2019.</em></p><p>Throughout the past quarter century, we have witnessed radical treatment advances and major developments in organ transplantation. This presentation will highlight the past 25 years of momentous advances and innovations in abdominal transplantation.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Miller80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><p><strong>Advances in Abdominal Transplant in the Last Quarter Century</strong><br />Charles M. Miller, MD<br />Enterprise Director of Transplantation<br />Director, Transplantation Center<br />Cleveland Clinic<br />Cleveland, OH</p></td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Planning Committee</span></h1><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>C. Fred LeMaistre, MD<br />Senior Vice President<br />Sarah Cannon Market Operations<br />Physician in Chief of Blood Cancers<br />Sarah Cannon<br />Nashville, TN</p><p>Tina Rydland, PharmD<br />Crystal Clear Rx<br />Denver, CO</p><p>Crystal Wong, MD<br />President<br />Propoint Medical Writing<br />Wexford, PA</p><