 Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63335, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(14, '2020-01-13', 1333, 'Peripheral Arterial Disease: Evidence-Based Guidelines for Identification, Management and Documentation', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p>This activity will review peripheral arterial disease (PAD) and explore tools that can be used to screen, assess, evaluate and diagnose this condition. Treatment options will be discussed as well as the documentation required to code to the highest level of specificity to promote improved patient outcomes and continuity of care.</p><p><strong>Provided By</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial Support</strong><br />This activity is supported by OptumCare.</p><p><strong>Hardware/Software Requirements</strong><br />To view this activity you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Presenter</strong><br /><img alt=\"Robin Eickhoff, MD, MPH, CPC\" data-delta=\"6\" src=\"https://www.optumhealtheducation.com/sites/default/files/robin.eickhoff.png\" style=\"width: 180px; height: 134px; float: left; margin-left: 5px; margin-right: 5px;\" />Robin Eickhoff, MD, MPH, CPC<br />Senior Medical Director<br />QRA Education, Wellmed Medical Group<br />San Antonio, TX</p><p><strong>About the presenter</strong><br />Robin Eickhoff, MD, MPH, CPC completed her undergraduate degree at San Diego State University. She earned her medical degree from Tulane University School of Medicine and her Master of Public Health from Tulane University School of Public Health and Tropical Medicine in New Orleans, LA.</p><p>Dr. Eickhoff is board certified by the American Board of Family Medicine. She is a member of the Texas Academy of Family Practice as well as the Bexar County Medical Society. In addition, Dr. Eickhoff served over 3 years as a flight surgeon in the United States Air Force while stationed at Dyess Air Force Base in Abilene, TX.</p><p><strong>Planners</strong><br />Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education (OHE) requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest. OHE ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>The remaining activity faculty or planners have no financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Method for calculating CE credit</strong><br />CE credit was calculated by the complexity of content.</p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"http://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><strong>Credit Designation Statements</strong><br /><strong>Nurse Practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-Certified Coders</strong><br />This program meets AAPC guidelines for 1.0 CEU. Can be used for Core A, CANPC and CHONC with successful completion of post-test for continuing education units.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63341, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0);
