ical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><br /><strong>Credit Designation Statements</strong><br /><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Pharmacists/Pharmacy technicians</strong><br />This activity is approved for 1.00 contact hour(s) ([0.10] CEU) in states that recognize ACPE.<br />Attending the full program will earn 1.00 contact hour(s).<br />Unique Activity Number(s): JA0007123-0000-20-136-H01-P/T</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>Case managers</strong><br />This program has been pre-approved by The Commission for Case Manager Certification to provide Ethics continuing education credit to CCM<sup></sup> board certified case managers. The course is approved for 1.0 CE contact hours.<br />CCMC Ethics credit is approved for this course. The CCMC Code of Professional Conduct will be referenced in this presentation. View the CCMC Code of Professional Conduct <a href=\"https://services.ccmcertification.org/ccmcssa/ecmssamsganalytics.click_through?p_mail_id=E337887A521649B1C342947\" target=\"_blank\">here.</a></p><p><strong>Psychologists andsocial workers</strong><br />Participants must have attended the entire Web-based activity and completed an evaluation to receive a certificate. Partial credit is not available.</p><p><strong>Psychologists</strong><br />OptumHealth Education is approved by the American Psychological Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social Workers</strong></p><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; width: 20%;\"><p style=\"text-align: left;\"><img alt=\"ACE Logo\" border=\"0\" height=\"51\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_135x51sm.jpg\" width=\"135\" /></p></td><td style=\"vertical-align:top; width: 80%;\"><p>As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63359, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(17, '2020-02-03', 1333, 'Value in Cancer Care: Finding the Path to Progress', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p><em>This activity consists of recorded presentations from the 28th Annual National Conference held in Minneapolis, Minn., on Oct. 15, 2019.</em></p><p>The cost of cancer care in the U.S. has increased dramatically over the last three decades. Among factors contributing to this huge increase are rising cancer prevalence, due in part to our aging population, and the rapidly increasing cost of pharmaceuticals and other interventions. Mounting physician fees and cost-sharing on the part of the insurance industry have also made a significant contribution.</p><p>Clearly as our health care system continues to shift from a focus on volume to one centered on value, innovative approaches to enhance value will be needed. Unfortunately, the path ahead is far from clear, in part because of the complexity of the disease itself.</p><p>With these considerations in mind, this session provides updates on some of the latest approaches to enhancing value in cancer care, as well as a look ahead at likely future directions in the field.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />There was no commercial support for this activity.</p><p><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Faculty</span></h1><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td align=\"center\" style=\"vertical-align:top; width: 17%;\"><img alt=\"Faculty Photo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Zafar80.gif\" style=\"margin-left: 20px; margin-right: 20px; margin-top: 20px; margin-bottom: 20px;\" /></td><td style=\"width: 83%;\"><strong>Cost Effectiveness in Cancer Care: Finding the Path to Progress</strong><br />Yousuf Zafar, MD, MHS, FASCO<br />Associate Professor of Medicine<br />Public Policy, and Population Science<br />Duke Cancer Institute<br />Durham, NC</td></tr></tbody></table><h1 class=\"title\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Planning Committee</span></h1><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>C. Fred LeMaistre, MD<br />Senior Vice President<br />Sarah Cannon Market Operations<br />Physician in Chief of Blood Cancers<br />Sarah Cannon<br />Nashville, TN</p><p>Tina Rydland, PharmD<br />Crystal Clear Rx<br />Denver, CO</p><p>Crystal Wong, MD<br />President<br />Propoint Medical Writing<br />Wexford, PA</p><p><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:22px; font-weight:normal\">Disclosures of relevant financial relationships</span></p><p>In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education (OHE) requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content. OHE ensures that the content is independent of commercial bias.</p><p>Dr. Zafar serves on the Advisory Board and is a Consultant for RTI, McKesson, Coernicus-WCG IRB. He has received grant/research support from the NIH and AstraZeneca. He and his spouse are employees of Shattuck Labs. Dr. Zafar has received other financial or material support from Aim Specialty Health;Vivor, LLC;SamFund; andFamily Research Foundation.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>Dr. Wong has indicated that she has received grant/research support from MyoKardia.</p><p>The remaining activity planners haveno financial relationships to disclose.</p></p> \n							</div>\n