r a maximum of 1.00 clock hour(s) for Certified Case Managers (CCM).</p><p><strong>Psychologists andsocial workers</strong><br />Participants must have attended the entire Web-based activity and completed an evaluation to receive a certificate. Partial credit is not available.</p><p><strong>Psychologists</strong><br />OptumHealth Education is approved by the American Psychological Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social Workers</strong></p><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; width: 20%;\"><p style=\"text-align: left;\"><img alt=\"ACE Logo\" border=\"0\" height=\"51\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_135x51sm.jpg\" width=\"135\" /></p></td><td style=\"vertical-align:top; width: 80%;\"><p>As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 enduringcontinuing education credit.</p></td></tr></tbody></table><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63371, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(18, '2020-01-13', 1333, 'January/February 2020: Forum for Evidence-Based Medicine', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p>Practicing evidence-based medicine (EBM) is important in todays health care environment because this model of care offers clinicians a way to enrich quality, provide patient satisfaction, reduce costs and improve outcomes. A common implementation of EBM involves the use of clinical practice algorithms during medical decision-making to encourage optimal care. This widely recognized practice is designed to address the persistent problem of clinical practice variation with the help of actionable information at the point of care. These E-newsletters will enable health care professionals (HCPs) to put new EBM into practice.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />This activity is supported by OptumCare.<br /><br /><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Activity planners</strong><br />Ken Cohen, MD, FACP<br />Chief Medical Officer<br />New West Physicians</p><p>John Hitt, MD, MBA<br />Sr. Medical Director<br />OptumCare</p><p>Geoffrey Heyer, MD<br />Sr. Clinical Practice Performance Consultant<br />OptumCare</p><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in the control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.</p><p>OptumHealth Education ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>The remaining activity faculty or planners have no financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation statement</strong><br /><img alt=\"Joint Logo\" style=\"float: left; margin-left: 5px; margin-right: 5px;\" class=\"media-element file-wysiwyg\" data-delta=\"1\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110_0.gif\" width=\"110\" height=\"70\" /> In support of improving patient care, this activity has been planned and implemented by OptumHealth Education. OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE) and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><strong>Credit designation statements</strong><br /><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em><sup></sup>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>American Board of Internal Medicine</strong><br />Successful completion of this CME activity, which includes participation in the evaluation component, enables the participant to earn up to 1.0 Medical Knowledge MOC points in the American Board of Internal Medicine\'s (ABIM) Maintenance of Certification (MOC) program. Participants will earn MOC points equivalent to the amount of CME credits claimed for the activity. It is the CME activity provider\'s responsibility to submit participant completion information to ACCME for the purpose of granting ABIM MOC credit.</p><p><u>Please note, by claiming ABIM points, you authorize OptumHealth Education to share your attendance information with the ABIM. </u></p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63377, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(19, '2020-01-26', 1333, 'Outpatient Management of Chronic Kidney Disease and Comorbidities', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p>This activity will review diagnostic criteria from the Kidney Disease: Improving Global Outcomes (KDIGO) study on chronic kidney disease (CKD). It will also discuss KDIGO guidelines for outpatient management of CKD and related comorbid conditions.</p><ul></ul><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />This activity is supported by OptumCare.</p><p><strong>Hardware/Software requirements</strong><br />To view this activity you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Presenter</strong><br />Kevin Heath, MD, MHL, FACP<br />Medical Director<br />OptumCare<br />Lawrence, KS</p><p><strong>Planners</strong><br />Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Tania M. Miedico, MD<br />Medical Director<br />Clinical Performance, OptumCare<br />Eden Prairie, MN</p><p><strong>Disclosures of Relevant Financial Relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup><small>SM</small></sup>, OptumHealth Education requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest. OptumHealth Education ensures that the content is independent of commercial bias.<br />Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.<br />The remaining activity faculty or planners have no financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Method for Calculating CE Credit</strong><br />CE credit was calculated by the complexity of content.</p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"http://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p></p><p><strong>Credit Designation Statements</strong><br /><strong>Nurse Practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-Certified Coders</strong><br />This program meets AAPC guidelines for 1.0 CEU. Can be used for Core A, CANPC and CHONC with successful completion of post-test for continuing education units.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63386, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0);
