(20, '2020-01-02', 1333, 'Generic Implants (January 2020)', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><p><em><strong>These materials are intended only for those that attend the live activity on Wednesday, Jan. 8, 2020.</strong></em></p><p><strong>Activity description</strong><br />Outpatient joint replacement surgery is considered by many to be safe, convenient and cost effective across an ever-widening array of procedures. This delivery model has the potential to increase patient comfort and satisfaction, while improving efficiency and reducing health care costs.</p><p>These monthly activities will review best practices for outpatient joint replacement protocols and procedures. They will focus on a model that enables improved access to high-quality care at lower costs with the goals of improving surgical care, mitigating risks and barriers to enable rapid discharge, and achieving high-quality patient outcomes.</p><p><strong>Provided by</strong><br />This activity is jointly provided by OptumHealth Education and Surgical Center of Greensboro.</p><p><strong>Commercial support</strong><br />There was no commercial support received for this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Program</strong><br />This one-hour live activity will be held Wednesday, Jan. 8, 2020, starting at 6:30 a.m. EST at the Surgical Center of Greensboro. This month\'s topic is \"Generic Implants.\"</p><p><strong>Presenter</strong><br />Stephen D. Lucey, MD<br />Orthopaedic Surgeon and Owner<br />Sports Medicine and Joint Replacement<br />Greensboro, NC</p><p><strong>About the presenter</strong><br />Dr. Lucey is a board-certified orthopedic surgeon living and practicing in Greensboro, N.C. He has been in private practice for 16 years and has fellowship training in sports medicine and joint reconstruction. His practice is focused on arthroscopy and arthroplasty of the knee and shoulder. Dr. Lucey\'s current special interests include stem cell research for cartilage restoration in the knee, development of patient-specific instrumentation and disposable instrumentation for partial and total knee replacement, and business development of joint replacement in the outpatient setting.</p><p><strong>Activity planners</strong><br />Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Frank J. Rowan, MD<br />Orthopaedic Surgeon<br />Guilford Orthopaedic and Sports Medicine Center Division<br />Southeastern Orthopaedic Specialists<br />Greensboro, NC</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in the control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.</p><p>OptumHealth Education ensures that the content is independent of commercial bias.<br />Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.<br />Dr. Lucey has indicated that he has no relevant financial relationships.<br />Dr. Rowan has indicated that he has no relevant financial relationships.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, this activity has been planned and implemented by OptumHealth Education and Surgical Center of Greensboro. OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE) and the American Nurses Credentialing Center (ANCC), to provide continuing education for the healthcare team.</p><p><strong>Credit designation statements</strong></p><p><strong>Physicians</strong><br />OptumHealth Education designates this live activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-certified coders </strong><br />AAPC will honor 1-for-1 CEUs for any live event offering CME credit or <em>AMA PRA Category 1 Credit</em>. A certificate of attendance or completion is necessary to show participation. The certificate will give the total CMEs possible for the offering. Physicians are advised to claim only the actual hours that they were present during the education. We ask that AAPC-certified members abide by this request also. One hour of instruction is worth 1 CEU.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63439, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(21, '2020-05-05', 1333, 'Extraordinary Innovations and Emerging Trends in Transplantation and Oncology from Nebraska Medicine', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><p style=\"text-align:left\"><span style=\"vertical-align:middle\"><img alt=\"header\" src=\"https://www.optumhealtheducation.com/sites/default/files/header_std_685x488_0.gif\" /></span></p><h3 style=\"text-align:center\">In light of the COVID-19 health crisis conference details are pending until after April 2020.</h3><table border=\"0\" cellpadding=\"0\" style=\"width:100%; border-spacing: 0px;\"><tbody><tr><td style=\"vertical-align:top; height: 74px; width: 60%;\"><p style=\"text-align: left;\">This accredited, two-day, multidisciplinary conference offers an overview on emerging trends in oncology, solid organ- and blood/marrow transplantation.</p></td><td style=\"vertical-align:top; width: 40%;\"><p style=\"text-align: right;\"><a href=\"https://ohe.s3.amazonaws.com/Neb2020.ics\" target=\"_blank\"><img alt=\"Save to Calendar\" src=\"https://www.optumhealtheducation.com/sites/default/files/savecalendar250x68_0.gif\" width=\"250\" /></a></p></td></tr></tbody></table><p style=\"text-align:left\">Clinical experts will share their knowledge and provide insight into innovative approaches to the ongoing management and continuing support of patients with complex cancers and organ failures.</p><p style=\"text-align:left\"><a href=\"https://www.optumhealtheducation.com/neb2020-notify\" target=\"_blank\">Sign me up</a> to receive a notification when registration opens.</p><p style=\"text-align:left\">Learn firsthand from industry leaders as they highlight the <strong>history, future, and ethical considerations of solid organ transplantation</strong>, including the history and role of the Organ Procurement and Transplantation Network (OPTN) and the United Network for Organ Sharing (UNOS), the recent organ-allocation changes and their effect on transplant centers and their patients, the use of alternative organ donors, and the latest strategies in organ preservation. Gain knowledge on alternatives to <strong>intestinal transplant</strong>, as well as the issues around <strong>heart transplants</strong> in patients with amyloidosis and <strong>liver transplants</strong> in patients with acute alcoholic hepatitis.</p><p style=\"text-align:left\">Specialists will address <strong>critical issues faced by the medical staff of cancer centers</strong> and the patients they care for. Speakers will discuss <strong>issues surrounding continuity of care</strong> as patients transition from the cancer center back to their communities and the multidisciplinary team needed to ensure the best outcomes. They will also examine the challenges they facesuch as obtaining oral therapy, receiving cutting-edge immunotherapy, and dealing with often-forgotten personal issues such as sexuality and body-image changes after cancer.</p><table border=\"0\" style=\"width:100%\"><tbody><tr><td align=\"left\" style=\"vertical-align:top; width: 10%;\"><a href=\"https://ohe.s3.amazonaws.com/Neb2020.ics\" target=\"_blank\"><img alt=\"calendar\" src=\"http://app.subscribermail.com/images/pp/55002142/2014_Announcement_Images/calendar60.jpg?mod=1412273949000\" /></a></td><td align=\"left\" style=\"vertical-align:middle; width: 90%;\"><p style=\"text-align:left; vertical-align:middle\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:14px; font-weight:normal\"><strong>SAVE THE DATE &gt;</strong></span> <a href=\"https://ohe.s3.amazonaws.com/Neb2020.ics\" target=\"_blank\"><u>Add to your calendar</u></a></p></td></tr></tbody></table><p style=\"text-align:left\"><span style=\"color:#63666a; font-family:Arial,Helvetica,sans-serif; font-size:14px; font-weight:normal\"><strong>LEARN MORE &gt;</strong></span> <a href=\"https://www.optumhealtheducation.com/neb2020-notify\" target=\"_blank\"><u>Notify me when the conference site is available</u></a>.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p>Credits are pending. Further details to come.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63463, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(22, '2020-01-24', 1333, 'Quality and Risk Workshop', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p>It is well known that patients with multiple serious medical conditions have higher costs of care and require more resources. In a typical fee-for-service model there are limited mechanisms to recognize and address these discrepancies. Risk Adjustment is a model that adjusts reimbursement based on the presence or absence of serious medical conditions such as diabetes or heart failure. Over time, more accurate coding results in more accurate reimbursement. As we continue to evolve the health care system to a more closely aligned fee-for-value model, risk adjustment plays a key role and has the potential to truly align resources and care.</p><p>This activity will review the basics of the risk adjustment system in Medicare and how accurate and appropriate diagnosis, documentation, coding, and care lead to improved patient benefits, such as transportation, and lower copaysas well as improved reimbursement for health plans and providers. The activity will move from an overview to a condition-focused review.</p><ol></ol><p><strong>Provided By</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial Support</strong><br />This activity is supported by OptumCollaborative Care.</p><p><strong>Hardware/Software Requirements</strong><br />To view this activity you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+, or Adobe Flash Player 9+. Be sure to disable your pop-up blocking software prior to the beginning of this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Faculty Listing</strong><br />Nikki Macalalad, MSN, APRN, FNP-C<br />Associate Director of Clinical Coding Education, CDQI<br />Southwest Medical Associates--part of OptumCare<br />Las Vegas, Nevada</p><p><strong>Disclosures of Relevant Financial Relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup><small>SM</small></sup>, OptumHealth Education requires all those involved in the development of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or their spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services are discussed in the activity content over which the individual has control.<br />OptumHealth Education ensures that the content is independent of commercial bias.</p><p><strong>Faculty Disclosure</strong><br />Ms. Macalalad reported that she has no relevant financial relationships.</p><p><strong>Activity Planners</strong><br />Kevin Heath, MD, MHL, FACP<br />National Medical Director for Education Solutions<br />Clinical Performance, OptumCare</p><p>Tania Miedico, MD<br />Medical Director<br />OptumCare</p><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education</p><p>V. Silverstein, MD<br />Eagle Creek Medical Communications<br />Durham, North Carolina</p><p><strong>Activity Planner Disclosures</strong><br />Ms. Chart and Ms. Gleason reported that they are employees of and own stock in UnitedHealth Group.<br />Dr. Heath, Dr. Miedico and Dr. Silverstein reported that they have no relevant financial relationships.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation Statement</strong><br /><img alt=\"Joint Accreditation Logo\" border=\"0\" height=\"70\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" width=\"110\" style=\"float: left; margin-left: 20px; margin-right: 20px; margin-top: 15px; margin-bottom: 15px;\" /> In support of improving patient care, OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE), and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p></p><p><strong>Credit Designation Statements</strong></p><p><strong>Physicians</strong><br />OptumHealth Education designates this live activity for a maximum of 12.00 <em>AMA PRA Category 1 Credit(s)</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>American Academy of Family Physicians</strong><br />This Live activity, Quality and Risk Workshop, from 10/02/2019- 10/02/2020, has been reviewed and is acceptable for up to 12.00 Prescribed credit(s) by the American Academy of Family Physicians. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>Physician Assistants</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-Certified Coders </strong><br />AAPC will honor 1-for-1 CEUs for any live event offering CME credit or <em>AMA PRA Category 1 Credit</em>. A certificate of attendance or completion is necessary to show participation. The certificate will give the total CMEs possible for the offering. Physicians are advised to claim only the actual hours that they were present during the education. We ask that AAPC-certified members abide by this request also. One hour of instruction is worth 1 CEU.</p><p><strong>Nurse Practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization to which you wish you apply credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63465, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(23, '2020-01-28', 1333, 'Journal Club: from Journal of Arthroplasty', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><p><em><strong>These materials are intended only for those that attend the live activity on Wednesday, February 12, 2020.</strong></em></p><p><strong>Activity description</strong><br />Outpatient joint replacement surgery is considered by many to be safe, convenient and cost effective across an ever-widening array of procedures. This delivery model has the potential to increase patient comfort and satisfaction, while improving efficiency and reducing health care costs.</p><p>These monthly activities will review best practices for outpatient joint replacement protocols and procedures. They will focus on a model that enables improved access to high-quality care at lower costs with the goals of improving surgical care, mitigating risks and barriers to enable rapid discharge, and achieving high-quality patient outcomes.</p><p><strong>Provided by</strong><br />This activity is jointly provided by OptumHealth Education and Surgical Center of Greensboro.</p><p><strong>Commercial support</strong><br />There was no commercial support received for this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Program</strong><br />This one-hour live activity will be held Wednesday, February 12, 2020, starting at 6:30 a.m. EST at the Surgical Center of Greensboro. This month\'s topic is \"Journal Club: from Journal of Arthroplasty.\"</p><p><strong>Presenter</strong><br />Frank V. Aluisio, MD<br />Orthopaedic Surgeon<br />Greensboro Orthopaedics<br />Greensboro, NC</p><p><strong>About the presenter</strong></p><p>Frank V. Aluisio, MD, is an orthopaedic surgeon who specializes in adult reconstructive surgery of the hip and knee. He was raised in New Hyde Park, NY, and received his BA and MD degrees from Emory University. Dr Aluisio did his residency training in orthopaedic surgery at Duke University Medical Center, and then completed the Otto Aufranc Adult Reconstruction Fellowship at New England Baptist Hospital in Boston.</p><p>Dr. Aluisio has been in orthopaedic practice with Greensboro Orthopaedics since 1998, specializing in complex primary and revision joint replacements of the hip and knee. He has presented his research at multiple state, regional and national meetings and has been an instructor of numerous surgical courses. Dr. Aluisio has also held several leadership positions in orthopaedics, including president of the North Carolina Orthopaedic Society and representative on the Board of Councilors for the American Academy of Orthopaedic Surgeons. His current practice focus is on outpatient hip and knee replacement and on developing physician-driven bundled-payment programs for arthroplasty procedures.</p><p><strong>Activity planners</strong><br />Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Frank J. Rowan, MD<br />Orthopaedic Surgeon<br />Guilford Orthopaedic and Sports Medicine Center Division<br />Southeastern Orthopaedic Specialists<br />Greensboro, NC</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in the control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.</p><p>OptumHealth Education ensures that the content is independent of commercial bias.<br />Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.<br />Dr. Rowan has indicated that he has no relevant financial relationships.<br />Dr. Aluisio has indicated that he has no relevant financial relationships.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation statement</strong><br /><img alt=\"Joint Accreditation Logo\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110.gif\" style=\"float: left; margin-left: 12px; margin-right: 12px;\" />In support of improving patient care, this activity has been planned and implemented by OptumHealth Education and Surgical Center of Greensboro. OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE) and the American Nurses Credentialing Center (ANCC), to provide continuing education for the healthcare team.</p><p><strong>Credit designation statements</strong></p><p><strong>Physicians</strong><br />OptumHealth Education designates this live activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit</em>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-certified coders </strong><br />AAPC will honor 1-for-1 CEUs for any live event offering CME credit or <em>AMA PRA Category 1 Credit</em>. A certificate of attendance or completion is necessary to show participation. The certificate will give the total CMEs possible for the offering. Physicians are advised to claim only the actual hours that they were present during the education. We ask that AAPC-certified members abide by this request also. One hour of instruction is worth 1 CEU.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63473, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
