(32, '2020-03-03', 1333, 'March/April 2020: Forum for Evidence-Based Medicine', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2>Activity description</h2><p>Practicing evidence-based medicine (EBM) is important in todays health care environment because this model of care offers clinicians a way to enrich quality, provide patient satisfaction, reduce costs and improve outcomes. A common implementation of EBM involves the use of clinical practice algorithms during medical decision-making to encourage optimal care. This widely recognized practice is designed to address the persistent problem of clinical practice variation with the help of actionable information at the point of care. These E-newsletters will enable health care professionals (HCPs) to put new EBM into practice.</p><p><strong>Provided by</strong><br />This activity is provided by OptumHealth Education.</p><p><strong>Commercial support</strong><br />This activity is supported by OptumCare.<br /><br /><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Activity planners</strong><br />Ken Cohen, MD, FACP<br />Chief Medical Officer<br />New West Physicians</p><p>John Hitt, MD, MBA<br />Sr. Medical Director<br />OptumCare</p><p>Geoffrey Heyer, MD<br />Sr. Clinical Practice Performance Consultant<br />OptumCare</p><p>Sarah Chart, RN<br />Senior Director<br />OptumHealth Education</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in the control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.</p><p>OptumHealth Education ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>The remaining activity faculty or planners have no financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation statement</strong><br /><img alt=\"Joint Logo\" style=\"float: left; margin-left: 5px; margin-right: 5px;\" class=\"media-element file-wysiwyg\" data-delta=\"1\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110_0.gif\" width=\"110\" height=\"70\" /> In support of improving patient care, this activity has been planned and implemented by OptumHealth Education. OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE) and the American Nurses Credentialing Center (ANCC) to provide continuing education for the health care team.</p><p><strong>Credit designation statements</strong><br /><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Physicians</strong><br />OptumHealth Education designates this enduring activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em><sup></sup>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>American Board of Internal Medicine</strong><br />Successful completion of this CME activity, which includes participation in the evaluation component, enables the participant to earn up to 1.0 Medical Knowledge Maintenance of Certification (MOC) points in the American Board of Internal Medicine\'s (ABIM) MOC program. Participants will earn MOC points equivalent to the amount of CME credits claimed for the activity. It is the CME activity provider\'s responsibility to submit participant completion information to ACCME for the purpose of granting ABIM MOC credit.</p><p><em>Please note, by claiming ABIM points, you authorize OptumHealth Education to share your attendance information with the ABIM.</em></p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been pre-approved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization with which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63565, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0),
(33, '2020-02-09', 1333, 'Pharmacogenomics: Providing Personalized Medicine', '<style>\n\n						.tab {\n						overflow: hidden;\n						}\n						\n						.tab button {\n						background-color: inherit;\n						float: left;\n						border: 1px solid #ccc;\n						outline: none;\n						cursor: pointer;\n						padding-top: 8px;\n						padding-bottom: 8px;\n						padding-right: 12px;\n						padding-left: 12px;\n						transition: 0.3s;\n						font-size: 14px;\n						border-radius: 5px;\n						margin-bottom: 10px;\n						margin-right: 12px;\n						}\n						\n						/* Change background color of buttons on hover */\n						.tab button:hover {\n						background-color: #eeeeee;\n						}\n						\n						/* Create an active/current tablink class */\n						.tab button.active {\n						color: #fff;    \n						background-color: #08c;\n						}\n						\n						/* Style the tab content */\n						.tabcontent {\n						display: none;\n						padding: 6px 12px;\n						border-top: none;\n						}\n						</style>\n						<div class=\"tab\">\n						<button class=\"tablinks active\" onclick=\"openCity(event, \'coursedescription\')\">Course Description</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'courseinstructor\')\">Instructor</button>\n						<button class=\"tablinks\" onclick=\"openCity(event, \'accreditation\')\">Accreditation</button>\n						</div>\n						\n						<div id=\"coursedescription\" class=\"tabcontent\" style=\"display:block\">\n						<h3>Course Description</h3>\n						<p><h2 style=\"margin-bottom:0.0001pt; margin-left:0in; margin-right:0in; margin-top:0in\">Activity description</h2><p>Pharmacogenomics is an important part of precision medicine; it is the study of how a persons genetic makeup can affect their response to a drug. Health care professionals (HCPs) can use pharmacogenomic information to help determine the most appropriate treatment for each individual. This activity will provide an overview on the clinical indications for using pharmacogenomics and explore resources for interpreting pharmacogenomics. The basic science of liver enzymes and their genetic variation will also be discussed.</p><p><strong>Provided by</strong><br />This activity is jointly provided by OptumHealth Education and UnitedHealthcare.</p><p><strong>Commercial support</strong><br />No commercial support was received for this activity.<br /><br /><strong>Required hardware/software</strong><br />To view this activity, you will need Internet Explorer 7.0+ or Firefox 3.0+ with Windows Media Player 9+, RealPlayer 12+ or Adobe Flash Player 9+. Be sure to disable any pop-up blocking software prior to beginning this activity.</p></p>\n						</div>\n						\n						<div id=\"courseinstructor\" class=\"tabcontent\">\n							<h3>Instructor</h3>\n							<p><p><strong>Presenter</strong><br /><img alt=\"Russ B. Altman, PhD, MD\" style=\"float: left; margin-left: 5px; margin-right: 5px; width: 120px; height: 120px;\" class=\"media-element file-wysiwyg\" data-delta=\"8\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/Russ_Altman.jpg\" width=\"120\" height=\"120\" />Russ B. Altman, PhD, MD<br />Kenneth Fong Professor of Bioengineering, Genetics, Medicine, Biomedical Data Science and (by courtesy) Computer Science<br />Stanford University<br />Stanford, CA</p><p><strong>About the presenter</strong><br />Russ B. Altman, PhD, MD, is board certified in Internal Medicine and in Clinical Informatics. Dr. Altman holds a BA from Harvard College, an MD from Stanford Medical School, and a PhD in Medical Information Sciences from Stanford. He received the U.S. Presidential Early Career Award for Scientists and Engineers and a National Science Foundation CAREER Award. He is a fellow of the American College of Physicians (ACP), the American College of Medical Informatics (ACMI), the American Institute of Medical and Biological Engineering (AIMBE) and the American Association for the Advancement of Science (AAAS). He is a member of the National Academy of Medicine (formerly the Institute of Medicine [IOM]). He is a past president, founding board member, and a fellow of the International Society for Computational Biology (ISCB) and a past president of the American Society for Clinical Pharmacology &amp; Therapeutics (ASCPT). He has chaired the Science Board advising the Commissioner of the U.S. Food and Drug Administration (FDA), served on the NIH Directors Advisory Committee and co-chaired the IOM Drug Forum.</p><p>Dr. Altmans primary research interests are in the application of computing and informatics technologies to problems relevant to medicine. He is particularly interested in methods for understanding drug action at molecular, cellular, organism and population levels. His lab studies how human genetic variation impacts drug response. His other work focuses on the analysis of biological molecules to understand the actions, interactions and adverse events of drugs. He helps lead an FDA-supported Center of Excellence in Regulatory Science &amp; Innovation.</p><p><strong>Activity planners</strong><br />Sarah Chart, RN<br />Senior Director<br />OptumHealth Education<br />Eden Prairie, MN</p><p>Rebecca Gleason, RN, CCM<br />Activity Manager<br />OptumHealth Education<br />Eden Prairie, MN</p><p><strong>Disclosures of relevant financial relationships</strong><br />In accordance with the ACCME Standards for Commercial Support<sup>SM</sup>, OptumHealth Education requires all those in control of activity content to disclose their relevant financial relationships. An individual has a relevant financial relationship if such person (or his/her spouse/partner) has a financial relationship in any amount occurring in the last 12 months with a commercial interest whose products or services relate to the activity content.</p><p>OptumHealth Education ensures that the content is independent of commercial bias.</p><p>Ms. Chart and Ms. Gleason have indicated that they are employees of and own stock in UnitedHealth Group.</p><p>Russ B. Altman, PhD, MD, has indicated the following relationships:</p><ul><li>Advisory Board: Personalis, Inc., Cogen Therapeutics, Goldfinch Bio and Youscript</li><li>Consultant: Personalis, Inc., Second Genome and United Health</li><li>Stocks and Other Ownership Interests: Personalis, Inc., 23 and me and Youscript</li></ul><p>The remaining activity faculty or planners have no financial relationships to disclose.</p></p> \n							</div>\n							\n							<div id=\"accreditation\" class=\"tabcontent\">\n							<h3>Accreditation</h3>\n							<p><p><strong>Accreditation statement</strong><br /><img alt=\"Joint Provider Logo\" style=\"margin-left: 5px; margin-right: 5px; float: left;\" class=\"media-element file-wysiwyg\" data-delta=\"3\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/Joint_Logo_sized70x110_0.gif\" width=\"110\" height=\"70\" />In support of improving patient care, this activity has been planned and implemented by OptumHealth Education and UnitedHealthcare. OptumHealth Education is jointly accredited by the Accreditation Council for Continuing Medical Education (ACCME), the Accreditation Council for Pharmacy Education (ACPE) and the American Nurses Credentialing Center (ANCC), to provide continuing education for the health care team.</p><p><strong>Credit designation statements</strong><br /><img alt=\"IPCE Credit Logo\" style=\"float: left; margin-left: 5px; margin-right: 5px;\" class=\"media-element file-wysiwyg\" data-delta=\"4\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/IPCE-Credit-70x110sm_0.jpg\" width=\"105\" height=\"70\" />This activity was planned by and for the health care team, and learners will receive 1.00 Interprofessional Continuing Education (IPCE) credits for learning and change.<br /></p><p><strong>Nurses</strong><br />The participant will be awarded up to 1.00 contact hour(s) of credit for attendance and completion of supplemental materials.</p><p><strong>Nurse practitioners</strong><br />The American Academy of Nurse Practitioners Certification Program (AANPCP) accepts credit from organizations accredited by the ACCME and ANCC.</p><p><strong>Pharmacists/Pharmacy technicians</strong><br />This activity is approved for 1.00 contact hour ([0.10] CEU) in states that recognize ACPE.<br />Attending the full program will earn 1.00 contact hour.<br />Unique Activity Number(s): JA0007123-9999-20-138-L04-P/T</p><p><strong>Physicians</strong><br />OptumHealth Education designates this live activity for a maximum of 1.00 <em>AMA PRA Category 1 Credit(s)</em><sup></sup>. Physicians should claim only the credit commensurate with the extent of their participation in the activity.</p><p><strong>PAs</strong><br />The American Academy of Physician Assistants (AAPA) accepts credit from organizations accredited by the ACCME.</p><p><strong>AAPC-certified coders</strong><br />AAPC will honor 1-for-1 CEUs for any live event offering CME credit or AMA PRA Category 1 Credit. A certificate of attendance or completion is necessary to show participation. The certificate will give the total CMEs possible for the offering. Physicians are advised to claim only the actual hours that they were present during the education. We ask that AAPC-certified members abide by this request also. One hour of instruction is worth 1 CEU.</p><p><strong>Case managers</strong><br />The Commission for Case Manager Certification has approved this program for a maximum of 1.00 clock hours for Certified Case Managers (CCM).</p><p><strong>Psychologists</strong><br />OptumHealth Education is approved by the American Psychological Association (APA) to offer continuing education for psychologists. OptumHealth Education maintains responsibility for this program. 1.00 CE hour.</p><p><strong>Social workers</strong><br /><img alt=\"ACE Logo\" style=\"float: left; margin-left: 5px; margin-right: 5px;\" class=\"media-element file-wysiwyg\" data-delta=\"5\" typeof=\"foaf:Image\" src=\"https://www.optumhealtheducation.com/sites/default/files/ACE_110x42sm.jpg\" width=\"110\" height=\"42\" />As a Jointly Accredited Organization, OptumHealth Education is approved to offer social work continuing education by the Association of Social Work Boards (ASWB) Approved Continuing Education (ACE) program. Organizations, not individual courses, are approved under this program. State and provincial regulatory boards have the final authority to determine whether an individual course may be accepted for continuing education credit. OptumHealth Education maintains responsibility for this course. Social workers completing this course receive 1.00 live continuing education credits.</p><p><strong>Counselors and/or marriage and family therapists</strong><br />CA: The Board of Behavioral Sciences has deferred CE course approvals to APA and ASWB for its licensees. See those approvals under Psychologists and Social Workers.<br />Other States: If your state is not specifically listed, nearly all state Counselor and MFT boards accept either APA or ASWB approval, or are reciprocal with other state licensing board approvals, such as those listed below. Check with your board to be sure.</p><p><strong>Attendance</strong><br />A certificate of attendance will be provided to learners upon completion of activity requirements, enabling participants to register with licensing boards or associations that have not been preapproved for credits. To apply for credit types not listed above, participants should use the procedure established by the specific organization from which they wish to obtain credit.</p></p>\n							</div>\n							\n							<script>\n							function openCity(evt, cityName) {\n								var i, tabcontent, tablinks;\n								tabcontent = document.getElementsByClassName(\"tabcontent\");\n								for (i = 0; i < tabcontent.length; i++) {\n								tabcontent[i].style.display = \"none\";\n								}\n								tablinks = document.getElementsByClassName(\"tablinks\");\n								for (i = 0; i < tablinks.length; i++) {\n								tablinks[i].className = tablinks[i].className.replace(\" active\", \"\");\n								}\n								document.getElementById(cityName).style.display = \"block\";\n								evt.currentTarget.className += \" active\";\n							}\n							</script>', 63574, NULL, NULL, 'true', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 'false', 0);
